import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import "./Home.css";

export default class Home extends Component {
  render() {
    return (
        <Container className="homeContainer" fluid>
          <Row>
            <Col>1 of 2</Col>
            <Col>2 of 2</Col>
          </Row>
          <Row>
            <Col>1 of 2</Col>
            <Col>2 of 2</Col>
          </Row>
        </Container>
    );
  }
}
